ent  -->\n\nZavaModule->PcoordComponent \n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n  \n\n    \n        \n            \n                \n                    \n                    \n                        1 Module\n                    \n                \n            \n        \n        \n            \n                \n                    \n                    1 Component\n                \n            \n        \n        \n            \n                \n                    \n                    2 Classes\n                \n            \n        \n    \n\n\n \n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"additional-documentation/usage.html":{"url":"additional-documentation/usage.html","title":"additional-page - Usage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\nUsage\nzava was built as an Angular library and meant for use with Angular applications (v11 or higher). \nInstallation\nTo use zava with your Angular application, install it from the npm repository.\nnpm i @oneoffcoder/zava @types/d3 @types/mathjs d3 mathjs --save-devModule import\nGo ahead and import ZavaModule into your app.module.ts file. A snippet is shown below.\nimport {ZavaModule} from '@oneoffcoder/zava';\n\n@NgModule({\n  declarations: [\n    AppComponent,\n    DefaultComponent\n  ],\n  imports: [\n    BrowserModule,\n    AppRoutingModule,\n    ZavaModule\n  ],\n  providers: [],\n  bootstrap: [AppComponent]\n})\nexport class AppModule { }Component\nIn any of your component, you can now use the component.\nYou might also want to add controls to animate the Grand Tour.\n\n  \n    Forward\n    Backward\n    Reset\n  \n  \n    Animation\n    Stop Animation\n  \nYour backing TypeScript file can access the component using @ViewChild.\n@ViewChild(PcoordComponent) private pcoord: PcoordComponent;The idea is then to set data on the component.\nngAfterViewInit(): void {\n    const data = this.getData();\n    this.pcoord.data = data;\n}\n\nprivate getData(): {headers: Array, data: Array>, colors: Array} {\n    headers = ['x1', 'x2'];\n    data = [[1, 2], [3, 4], [5, 6]];\n    colors = ['blue', 'green', 'black'];\n    return {headers, data, colors};\n}Make sure you add handlers for the buttons.\nrotateForward(): void {\n    this.pcoord.rotateForward();\n}\n\nrotateBackward(): void {\n    this.pcoord.rotateBackward();\n}\n\nresetRotation(): void {\n    this.pcoord.resetRotation();\n}\n\nanimateRotation(): void {\n    this.pcoord.startRotationAnimation();\n}\n\nstopRotation(): void {\n    this.pcoord.stopAnimationRotation();\n}Barebones Example\nA complete working example is available.\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"additional-documentation/development.html":{"url":"additional-documentation/development.html","title":"additional-page - Development","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\nDevelopment\nThis project was generated with Angular CLI version 11.0.4.\nDevelopment server\nRun ng serve for a dev server. Navigate to http://localhost:4200/. The app will automatically reload if you change any of the source files.\nCode scaffolding\nRun ng generate component component-name to generate a new component. You can also use ng generate directive|pipe|service|class|guard|interface|enum|module.\nBuild\nRun ng build to build the project. The build artifacts will be stored in the dist/ directory. Use the --prod flag for a production build.\nRunning unit tests\nRun ng test to execute the unit tests via Karma.\nRunning end-to-end tests\nRun ng e2e to execute the end-to-end tests via Protractor.\nFurther help\nTo get more help on the Angular CLI use ng help or go check out the Angular CLI Overview and Command Reference page.\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"additional-documentation/about.html":{"url":"additional-documentation/about.html","title":"additional-page - About","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\nAbout\n\nOne-Off Coder is an educational, service and product company. Please visit us online to discover how we may help you achieve life-long success in your personal coding career or with your companyâ€™s business goals and objectives.\n\nWebsite\nFacebook\nTwitter\nInstagram\nYouTube\nLinkedIn\n\nCopyright\nSoftware\nCopyright 2020 One-Off Coder\n\nLicensed under the Apache License, Version 2.0 (the \"License\");\nyou may not use this file except in compliance with the License.\nYou may obtain a copy of the License at\n\n    http://www.apache.org/licenses/LICENSE-2.0\n\nUnless required by applicable law or agreed to in writing, software\ndistributed under the License is distributed on an \"AS IS\" BASIS,\nWITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or implied.\nSee the License for the specific language governing permissions and\nlimitations under the License.Book\nCopyright 2020 One-Off Coder\nThis work is licensed under a Creative Commons Attribution 4.0 International License by One-Off Coder.\n\nArt\nCopyright 2020 Daytchia Vang\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"}}
